import React from "react";
import s from './Dialogs.module.css';


const Dialogs = (props) => {
    return (
        <div className="dialogs">
            <div className="dialog">
                <div className="item">
                    Vadym
                </div>
                <div className="item">
                    Klaudia
                </div>
                <div className="item">
                    Maksim
                </div>
            </div>
        </div>
    )
}

export default Dialogs;
